import GridTable from "@nadavshaar/react-grid-table";
import data from "./data.json";
import getColumns from "./getProductColumns.js";

export const Products = (props) => {
    return (
    <div>
        <h2>Products</h2>
        <GridTable
            columns={getColumns()}
            rows={props.products}
            onRowClick={props.stateChanger('inventory')}
        />
    </div>
  );
};
